Всемирный банк (также Мировой банк, англ. The World Bank) — международная финансовая организация со штаб квартирой в Вашингтоне, предоставляющая государствам кредиты, беспроцентные займы и гранты с целью получения прибыли. В процессе своего развития Всемирный банк претерпевал различные структурные изменения, поэтому под термином Всемирный банк на разных этапах понимались разные организации. В начале Всемирный банк ассоциировался с Международным банком реконструкции и развития, осуществлявшим финансовую поддержку в восстановлении после Второй мировой войны Западной Европы и Японии. Позднее, в 1960 году, была создана Международная ассоциация развития, которая взяла на себя часть функций, связанных с политикой этого банка. В настоящее время под Всемирным банком фактически понимают две организации: 
* Международный банк реконструкции и развития; 
* Международная ассоциация развития. В разное время к ним присоединились созданные для решения задач Всемирного банка ещё три организации: 
* Международная финансовая корпорация; 
* Многостороннее агентство по гарантиям инвестиций; 
* Международный центр по урегулированию инвестиционных споров. Все пять организаций входят в Группу организаций Всемирного банка и называются Группой Всемирного банка.В отдельных случаях под Всемирным банком по-прежнему понимается Международный банк реконструкции и развития, который до сих пор составляет основу деятельности Всемирного банка.

La Banque mondiale, parfois abrégée BM (en anglais : World Bank), est une institution financière internationale qui accorde des prêts à effet de levier à des pays en développement pour des projets d'investissement. La Banque mondiale comprend deux institutions - la Banque internationale pour la reconstruction et le développement (BIRD) et l’Association internationale de développement (IDA en anglais) - créées pour lutter contre la pauvreté en apportant des aides, des financements et des conseils aux États en difficulté. La Banque mondiale est un sous-ensemble du Groupe de la Banque mondiale qui est constitué de 5 organisations financières internationales au total : 
* la Banque internationale pour la reconstruction et le développement (BIRD) ; 
* l’Association internationale de développement (IDA) ; 
* la Société financière internationale (IFC) ; 
* l'Agence multilatérale de garantie des investissements (MIGA) ; 
* le Centre international pour le règlement des différends relatifs aux investissements (CIRDI). Le siège de la Banque mondiale se trouve à Washington, D.C. et le local à Genève en Suisse. La Banque mondiale est dirigée par un directeur général et présidée par le président du Groupe de la Banque mondiale. Tous deux sont élus par le Conseil des administrateurs du Groupe de la Banque mondiale. Elle fait partie des institutions spécialisées du système de l'Organisation des Nations unies (ONU). Elle publie tous les ans une contribution sur un thème du développement dans son Rapport sur le développement dans le monde. C’est aussi un important employeur de chercheurs (un quart environ de ses 9 200 collaborateurs ont un doctorat). C'est le premier prêteur d’argent d'origine publique au monde. La BIRD, le principal organe de la Banque mondiale, compte actuellement 189 pays membres.
